<?php

namespace Tests\Feature;

use App\Image;
use App\Legal;
use App\User;
use RootSeeder;
use Tests\TestCase;
use Illuminate\Foundation\Testing\RefreshDatabase;

class ImageFileTest extends TestCase
{
    use RefreshDatabase;

    public function setUp(): void
    {
        parent::setUp();

        $this->seed(RootSeeder::class);
    }

    public function testGet__200()
    {
        $user = factory(User::class)->create(['enabled' => true]);

        $image = factory(Image::class)->create([
            'user_id' => $user->id
        ]);

        $response = $this->actingAs($user)
                         ->get("/api/1/files/images/$image->id");

        $response->assertStatus(200);
    }

    public function testPost__200()
    {
        $user = factory(User::class)->create(['enabled' => true]);

        $payload = [
            'base64data' => 'data:application/octet-stream;base64,',
            'part'       => 0,
            'filename'   => 'Image007.jpeg',
        ];

        $response = $this->actingAs($user)
                         ->postJson("/api/1/files/images", $payload);

        $response->assertStatus(200);
    }

    public function testGetThumbnail__finalGradient_200()
    {
        $user = factory(User::class)->create([
            'enabled' => true
        ]);

        $image = factory(Image::class)->create([
            'user_id' => $user->id
        ]);

        $image->generateThumbnail();

        $response = $this->actingAs($user)
                         ->get("/api/1/files/images/$image->id/thumbnail");

        $response->assertStatus(200);
    }

    public function testGetThumbnail__finalCustom_200()
    {
        $user = factory(User::class)->create([
            'enabled' => true
        ]);

        $original = factory(Image::class)->create([
            'type'       => Image::TYPE_RAW,
            'background' => Image::BG_CUSTOM,
        ]);

        factory(Legal::class)->create([
            'shared'   => true,
            'image_id' => $original->id,
        ]);

        $final = factory(Image::class)->create([
            'original_id' => $original->id,
            'background'  => Image::BG_CUSTOM,
        ]);

        $final->generateThumbnail();

        $response = $this->actingAs($user)
                         ->get("/api/1/files/images/$final->id/thumbnail");

        $response->assertStatus(200);
    }

    public function testGetThumbnail__finalCustomMissingLegal_403()
    {
        $user = factory(User::class)->create([
            'enabled' => true
        ]);

        $original = factory(Image::class)->create([
            'type'       => Image::TYPE_RAW,
            'background' => Image::BG_CUSTOM,
        ]);

        $final = factory(Image::class)->create([
            'original_id' => $original->id,
            'background'  => Image::BG_CUSTOM,
        ]);

        $final->generateThumbnail();

        $response = $this->actingAs($user)
                         ->get("/api/1/files/images/$final->id/thumbnail");

        $response->assertStatus(403);
    }

    public function testGetThumbnail__finalCustomDeletedUser_200()
    {
        $user = factory(User::class)->create([
            'enabled' => true
        ]);

        $creator = factory(User::class)->create([
            'enabled'    => true
        ]);

        $final = factory(Image::class)->create([
            'background'  => Image::BG_GRADIENT,
            'user_id'     => $creator->id,
        ]);

        $final->generateThumbnail();

        $creator->delete();

        $response = $this->actingAs($user)
                         ->get("/api/1/files/images/$final->id/thumbnail");

        $response->assertStatus(200);
    }

    public function testPost__adminInvalidFileExtension__422()
    {
        $user = factory(User::class)->create(['enabled' => true]);

        $payload = [
            'base64data' => 'data:application/octet-stream;base64,',
            'part'       => 0,
            'filename'   => 'Image007.php',
        ];

        $response = $this->actingAs($user)
                         ->postJson("/api/1/files/images", $payload);

        $response->assertStatus(422);
    }
}
